import React from 'react'
import './DanceTourCard.css'

function DanceTourCard(props) {
  return (
    <>
          {
            props.items.map(
              card => (
                  <div>
                    <div class="card text-white" id='dancetour-card'>
                        <img src={card.img} class="card-img-top" id='card-img' alt="..." />
                        <div class="card-body text-center bg-dark" id='card-bottom'>
                            <h5 class="card-title text-uppercase">{card.title}</h5>
                            <p class="card-text">{card.text}</p>
                        </div>
                    </div>
                  </div>
              )
            )
          }
            
    </>
  )
}

export default DanceTourCard
